!> Solid orbitals transform matrix for a given l
!!
recursive subroutine Y_Rotation_Matrix(l,R,Rl,Rl_dim)
  
  use mod_TransformUtils
  
  implicit none
  
  ! input variables
  integer     , intent(in)                :: l      !< momentum for which we want the tranform matrix
  real(kind=8), intent(in) , dimension(*) :: R      !< 3 by 3 rotation matrix in the real space
  real(kind=8), intent(out), dimension(*) :: Rl     !< corresponding rotation within the cubic harmonics coefficients
  integer     , intent(out)               :: Rl_dim !< info on dimension of Rl (i.e. ld by ld)
  
  select case (l)
    case(0)
      call transform_Y_0(R,Rl,Rl_dim)
    case(1)
      call transform_Y_1(R,Rl,Rl_dim)
    case(2)
      call transform_Y_2(R,Rl,Rl_dim)
    case(3)
      call transform_Y_3(R,Rl,Rl_dim)
    case(4)
      call transform_Y_4(R,Rl,Rl_dim)
    case(5)
      call transform_Y_5(R,Rl,Rl_dim)
    case(6)
      call transform_Y_6(R,Rl,Rl_dim)
    case default
      print*,'Error: Y_Rotation_Matrix not implemented for l>6'
      stop -1
  end select
  
end subroutine

